import Container from '../components/container';

function Index({ gifs }) {
  return (
    <Container>
      {gifs.data.map((gif) => (
        <li>
          <img src={gif.images.url} width="400" height="300"></img>
        </li>
      ))}
    </Container>
  );
}

export async function getStaticProps() {
  const apiKey = 'MABWKnnDnZ9l8dALV6HfxnH1DVYpoX1J';
  const res = await fetch(
    `http://api.giphy.com/v1/gifs/search?q=ryan+gosling&api_key=${apiKey}&limit=5`
  );
  const gifs = await res.json();

  console.log(gifs.data[0].images);

  return {
    props: {
      gifs,
    },
  };
}

export default Index;
